import React from 'react'
import './navbar.css';
import Login from '../Login/Login'
import RegisterAsSeller from '../RegisterAsSeller/RegisterAsSeller'
import ViewAllCategoriesForCustomer from '../Category/VIewAllCategoriesForCustomer/ViewAllCategoriesForCustomer'
import Welcome from '../Welcome';
const Navbar = (props) => {
    let content=null;
    const handler1=()=>{
        content=<RegisterAsSeller/>
        window.location.reload(false)
    }
    const handler2=()=>{
        content=<Welcome/>
    }
    return (
    <div style={{height:"700px"}}>
    <div style={{backgroundColor:"white",float:"left"}} class="navbar navbar-inverse navbar-fixed-left">       

            {props.children}
            <a onClick={handler1}>Link 1</a>
            <a onClick={handler2}>Link 2</a>

    </div>
    <div style={{marginLeft:"300px"}}> 
        {content}
        </div>

        </div>
    )
}

export default Navbar
